import React from 'react';

const data = {
  project: [
    {
      id: 1,
      name: 'Crypto Tracker',
      description:
        'Application pour suivre la progression des cryptomonnaies actualisée en temps réel.',
      img: '/img/crypto.png',
      tag: '#React JS, #API',
      githubLink: 'https://theodaguier.github.io/crypto-tracker/',
      view: '...',
    },
    {
      id: 2,
      name: 'Elements',
      description: 'Tableau périodique des éléments.',
      githubLink: '...',
      view: '...',
      tag: '#React JS, #API',
    },
    {
      id: 3,
      name: 'Note App',
      description: 'Application de prise de note rapide.',
      githubLink: '...',
      view: '...',
      tag: '#React JS',
    },
  ],
};

function projectList() {
  return data.map((projectsData) => (
    <AppleWindow
      key={projectsData.id}
      name={projectsData.name}
      image={projectsData.img}
      description={projectsData.description}
      tag={projectsData.tag}
      githubLink={projectsData.githubLink}
    />
  ));
}

export default data;
